SELECT DISTINCT "Brand" 
FROM shipment 
WHERE "Country" IN ('Vietnam', 'Nigeria');

SELECT "Shipment Mode", AVG("Unit Price") AS Average_Unit_Price
FROM shipment
GROUP BY "Shipment Mode";

SELECT "Country", "Shipment Mode", AVG("Unit Price") AS Average_Unit_Price
FROM shipment
GROUP BY "Country", "Shipment Mode";

SELECT "First Line Designation", COUNT(*) AS entry_count
FROM shipment
GROUP BY "First Line Designation";
